      SUBROUTINE AVERAG(MODEAV,IVT,ABLG,TAULG)                                  
      IMPLICIT REAL*8 (A-H,O-Z)
      COMMON/LINDAT/WL,GFLOG,XJ,E,XJP,EP,CODE,LABEL(3),LABELP(3),       
     1               GAMMAR,GAMMAS,GAMMAW,REF,X1,           
     2               X2,OTHER1(3),OTHER2(3),ELO,GF,ISO1,ISO2,                              
     3               NBLO,NBUP,NELION
      REAL*8 WL,E,EP                                                            
      COMMON /OBS/EW,WLOBS,STAR(19)                                             
      COMMON /VTS/VTS(3),NVT                                                    
      COMMON ABUNDI(250,3),TAUBAR(250,3)                                        
      DIMENSION KABUND(250,3)                                                   
C      EQUIVALENCE (KABUND(1),ABUNDI(1))                                         
      DIMENSION EPOT(250),WDTH(250)                                             
      DIMENSION STAR1(20)                                                       
      DATA NLINES/0/                                                            
C      EXP10(X)=EXP(X*2.30258509299405E0)                                        
      IF(MODEAV.EQ.1)RETURN                                                     
      IF(MODEAV.EQ.2)GO TO 64                                                   
      IF(MODEAV.EQ.3)GO TO 30                                                   
      CALL EXIT                                                                 
   64 IF(IVT.EQ.1)NLINES=NLINES+1                                               
      ABUNDI(NLINES,IVT)=ABLG                                                   
      TAUBAR(NLINES,IVT)=TAULG                                                  
      EPOT(NLINES)=ELO*1.23984182E-4                                               
      WDTH(NLINES)=EW                                                           
      DO 25 I=1,19                                                              
   25 STAR1(I)=STAR(I)                                                          
      SAVE=CODE                                                                 
      RETURN                                                                    
   30 IF(NLINES.NE.1) GO TO 31                                                  
      DEV=0.                                                                    
      CODE=SAVE                                                                 
      WRITE(6,33)NLINES,CODE,ABLG,DEV                                           
      GO TO 35                                                                  
   31 DO 34 IVT=1,NVT                                                           
      SUMM=0.                                                                   
      CSUMXY=0.                                                                 
      CSUMX=0.                                                                  
      CSUMXX=0.                                                                 
      WSUMXY=0.                                                                 
      WSUMX=0.                                                                  
      WSUMXX=0.                                                                 
      DO 6005 I=1,NLINES                                                        
      SUMM=SUMM+ABUNDI(I,IVT)                                                   
      CSUMXY=CSUMXY+ABUNDI(I,IVT)*EPOT(I)                                       
      CSUMX=CSUMX+EPOT(I)                                                       
      CSUMXX=CSUMXX+EPOT(I)**2                                                  
      WSUMXY=WSUMXY+ABUNDI(I,IVT)*WDTH(I)                                       
      WSUMX=WSUMX+WDTH(I)                                                       
      WSUMXX=WSUMXX+WDTH(I)**2                                                  
 6005 CONTINUE                                                                  
      X=NLINES                                                                  
      WB=( X*WSUMXY-WSUMX*SUMM)/(X*WSUMXX-WSUMX**2)                             
      CB=(X*CSUMXY-CSUMX*SUMM)/(X*CSUMXX-CSUMX**2)                              
      AVABN=SUMM/X                                                              
      SUM=0.                                                                    
      DO 32 I=1,NLINES                                                          
   32 SUM=SUM+(AVABN-ABUNDI(I,IVT))**2                                          
      DEV=SQRT(SUM/X)                                                           
      DO 26 I=1,19                                                              
   26 STAR(I)=STAR1(I)                                                          
      CODE=SAVE                                                                 
      WRITE(6,1111)VTS(IVT),STAR                                                
 1111 FORMAT(6H1VTURB,F6.3,3X,19A4)                                             
      WRITE(6,33)NLINES,CODE,AVABN,DEV                                          
   33 FORMAT(///26H ***** THE ABUNDANCE FROM I3,2XF11.2,9H LINES ISF7.2,        
     1 3H+/-,F5.2)                                                              
      WRITE(6,6006)                                                             
 6006 FORMAT(//5X17HLOG ABUND VS. CHI)                                          
      DO 50 I=1,NLINES                                                          
   50 KABUND(I,IVT)=(AVABN-ABUNDI(I,IVT))*50.+51.5                              
      WRITE(6,6009)CB,NLINES                                                    
 6009 FORMAT(5X7H SLOPE=E10.3,14H PER EV USING I4,6H LINES)                     
      CALL PLOTIT(AVABN,KABUND(1,IVT),EPOT,NLINES)                              
      WRITE(6,1111)VTS(IVT),STAR                                                
      WRITE(6,6007)                                                             
 6007 FORMAT(//5X23HLOG ABUND VS. EQ. WIDTH)                                    
      WRITE(6,6008)WB,NLINES                                                    
 6008 FORMAT(5X7H SLOPE=E10.3,14H PER PM USING I4,6H LINES)                     
      CALL PLOTIT(AVABN,KABUND(1,IVT),WDTH,NLINES)                              
      WRITE(6,1111)VTS(IVT),STAR                                                
      WRITE(6,1112)                                                             
 1112 FORMAT(//5X24HLOG ABUND VS. LOG HEIGHT)                                   
      CALL PLOTIT(AVABN,KABUND(1,IVT),TAUBAR(1,IVT),NLINES)                     
   34 CONTINUE                                                                  
   35 NLINES=0                                                                  
      MODEAV=1                                                                  
      WRITE(6,3333)                                                             
 3333 FORMAT(1H1)                                                               
      RETURN                                                                    
      END                                                                       
      SUBROUTINE PLOTIT(AVX,KX,Y,N)                                             
      IMPLICIT REAL*8 (A-H,O-Z)
      DIMENSION KX(1),Y(1)                                                      
      DIMENSION IPLOT(101),AXIS(11)                                             
      DATA IBLANK,IDOT,IMINUS,II,IX,I2/1H ,1H.,1H-,1HI,1HX,1H2/                 
      DO 6  I=1,11                                                              
    6 AXIS(I)=AVX+.2*FLOAT(6-I)                                                 
      YMAX=-1.E30                                                               
      YMIN=1.E30                                                                
      DO 1 I=1,N                                                                
      YMIN= MIN (YMIN,Y(I))                                                     
    1 YMAX= MAX (YMAX,Y(I))                                                     
      IF(YMIN.GT.0.)YMIN=0.                                                     
      SLOPE=50./(YMAX-YMIN)                                                     
      DO 3  J=1,51                                                              
      ISYMB=IBLANK                                                              
      IF(MOD(J,10).EQ.1)ISYMB=IMINUS                                            
      DO 4  K=1,101                                                             
    4 IPLOT(K)=ISYMB                                                            
      DO 44 K=2,100,2                                                           
   44 IPLOT(K)=IBLANK                                                           
      DO 40 K=1,101,10                                                          
   40 IPLOT(K)=IDOT                                                             
      IPLOT(51)=II                                                              
      DO 5  I=1,N                                                               
      IY=51.5-SLOPE*(Y(I)-YMIN)                                                 
      IF(IY.NE.J)GO TO 5                                                        
      L=KX(I)                                                                   
      IF(L.LT.1) GO TO 5                                                        
      IF(L.GT.101)  GO TO 5                                                     
      IF(IPLOT(L).EQ.IX) GO TO 7                                                
      IPLOT(L)=IX                                                               
      GO TO 5                                                                   
    7 IPLOT(L)=I2                                                               
    5 CONTINUE                                                                  
      YY=FLOAT(51-J)/SLOPE+YMIN                                                 
      WRITE(6,10)YY,IPLOT                                                       
   10 FORMAT(F12.2,1X101A1)                                                     
    3 CONTINUE                                                                  
      WRITE(6,20) AXIS                                                          
   20 FORMAT(5X,11F10.2)                                                        
      RETURN                                                                    
      END                                                                       
      FUNCTION VOIGT(V,A)                                                       
      IMPLICIT REAL*8 (A-H,O-Z)
C     FUNCTION H(A,V)                                                           
c     FROM ERIC PEYTREMANN                                                      
      LOGICAL Q                                                                 
      VV=V*V                                                                    
      Q=A.LT.0.2                                                                
      IF(Q.AND.V.GT.5.)GOTO 1                                                   
      IF(.NOT.Q.AND.(A.GT.1.4.OR.A+V.GT.3.2))GOTO 2                             
      HO=EXP(-VV)                                                               
      H2=(1.-2.*VV)*HO                                                          
      IF(V.GT.2.4)GOTO 3                                                        
      IF(V.GT.1.3)GOTO 4                                                        
      H1=(.42139*VV-2.34358*V+3.28868)*VV-.15517*V-1.1247                       
    5 IF(Q)GOTO 6                                                               
      HH1=H1+HO*1.12838                                                         
      HH2=H2+HH1*1.12838-HO                                                     
      HH3=(1.-H2)*.37613-HH1*.66667*VV+HH2*1.12838                              
      HH4=(3.*HH3-HH1)*.37613+HO*.66667*VV*VV                                   
c     H=((((HH4*A+HH3)*A+HH2)*A+HH1)*A+HO)*(((-.122727278*A+.532770573)*        
      VOIGT=                                                                    
     A  ((((HH4*A+HH3)*A+HH2)*A+HH1)*A+HO)*(((-.122727278*A+.532770573)*        
     1A-.96284325)*A+.979895032)                                                
      RETURN                                                                    
    1 VOIGT=((2.12/VV+.8463)/VV+.5642)*A/VV                                     
c   1 H=((2.12/VV+.8463)/VV+.5642)*A/VV                                         
      RETURN                                                                    
    2 AA=A*A                                                                    
      U=(AA+VV)*1.4142                                                          
      UU=U*U                                                                    
c     H=((((AA-10.*VV)*AA*3.+15.*VV*VV)/UU+3.*VV-AA)/UU+1.)*A*.79788/U          
      VOIGT=                                                                    
     A  ((((AA-10.*VV)*AA*3.+15.*VV*VV)/UU+3.*VV-AA)/UU+1.)*A*.79788/U          
      RETURN                                                                    
    3 H1=((-.0032783*VV+.0429913*V-.188326)*VV+.278712*V+.55415)/(VV-1.5        
     1)                                                                         
      GOTO 5                                                                    
    4 H1=(-.220416*VV+1.989196*V-6.61487)*VV+9.39456*V-4.4848                   
      GOTO 5                                                                    
    6 VOIGT=(H2*A+H1)*A+HO                                                      
c   6 H=(H2*A+H1)*A+HO                                                          
      RETURN                                                                    
      END                                                                       
      subroutine ATLAS9
c     revised 18jan00
C     TAPE1 ROSSELAND OPACITY TABLES TO BE READ IF ABUNDANCE NOT 1X SOLAR
C     TAPE2 MOLECULAR EQUILIBRIUM CONSTANTS
C     TAPE5 INPUT
